import './App.css';

const Person = (props) => {
  return (
    <>
      <h1>Name: {props.name}</h1>
      <h2>Age: {props.name}</h2>
    </>
  );
};

const App = () => {
  return (
    <div className="App">
      <Person name="Harshith" age={23} />
      <Person name="Rohith" age={22} />
    </div>
  );
}

export default App;
